import React from "react";
import styled from "styled-components";

function ItemListContainer() {
    return (
      <div>
        <ListContainer>
        <p>Bienvenido a STADIUM</p>
        </ListContainer>
      </div>
    );
  }
  
  export default ItemListContainer;

  const ListContainer = styled.item`
  p{
  color: black;
  font-size : 50px;
  }
  `
